window.bookSummaryJSON = "<p><b>From number one </b><b><i>New York Times</i></b><b> best-selling author Lauren Blakely comes a sexy, emotional, and deliciously addictive trilogy performed with all new narration from Joe Arden and Vanessa Edwin....</b></p> <p>Let me tell you everything I know about love....</p> <p>Love is a lie, a game, a chase. And most of all - it’s a battle every man and woman must fight for themselves.</p> <p>I don’t trust love for a second.</p> <p>Until I meet Trey.</p> <p>He’s just like me - dangerous, scarred, and keeping secrets that might be darker than mine.</p> <p>And I can’t seem to stay away from him even though I’ve promised to.</p> <p>How can this be the start of something when tomorrow it has to end?</p> <p><i>The Start of Us</i> is the first novel in the No Regrets Trilogy.</p>"; 
